//get prayer time by city and date
function getPrayerTime(cityIndex,m, d) {
    
    for (var nIndex = 0; nIndex < db[cityIndex].PrayerTimes.length; nIndex++)
    {
        if (db[cityIndex].PrayerTimes[nIndex].Month == m && db[cityIndex].PrayerTimes[nIndex].Day == d)
        {
            return db[cityIndex].PrayerTimes[nIndex];
        }
    }
}